    return (
        <View style={styles.container}>
            <View style={styles.titleContainer}>
                <Text style={styles.title}>Locations</Text>
            </View>
            <TextInput
      style={{ height: 30, borderColor: 'gray', borderWidth: 1, marginBottom: 15, marginLeft:169, width: Dimensions.get('window').width * 0.44, backgroundColor: '#e3e3e3', borderRadius: 25, paddingLeft: 20, }}
